  \"Baseline Marine Biological Survey Peacock Point Outfall and Other Point-Source
  Discharges, Wake Atoll, Pacific Ocean\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  46,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:38:32.474129\",\n\t\"name\": \"baseline-marine-biological-survey-peacock-point-outfall-and-other-point-source-discharges-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"On behalf of the U.S. Army Space and Missile
  Defense Command, biologists from the U.S. Fish and Wildlife Service and the National
  Marine Fisheries Service were invited to Wake Atoll in June 1998. The purpose of
  the visit was to conduct baseline biological surveys in the vicinity of the Peacock
  Point outfall pipe and to examine the sites of other point-source discharges to
  the marine environment (i.e., power plant, desalinization plant, and storm water
  outlets). The biologists were asked to (1) generally characterize the coral-reef
  habitats within the vicinity of the outfall, (2) document the primary species of
  reef fishes, corals, other macroinvertebrates, and algae that exist in those habitats,
  and (3) investigate whether the reef communities at the other sites appeared to
  have been impacted by the discharges. This report contains the results of these
  surveys.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
